declare const styles: {
    Container: {
        position: "absolute";
        height: number;
        width: number;
    };
    Items: {
        position: "absolute";
        bottom: number;
        right: number;
    };
    Item: {
        marginBottom: number;
    };
    FABButton: {
        position: "absolute";
        width: number;
        height: number;
        bottom: number;
        right: number;
        borderRadius: number;
        justifyContent: "center";
        alignItems: "center";
    };
};
export default styles;
